import React from 'react'

   const Objects = ({ objects }) => {
     return (
       <div>
         <center><h1>Contact List</h1></center>
         {objects.map((objects) => (
           <div class="card">
             <div class="card-body">
               <h5 class="card-title">{objects.name}</h5>

             </div>
           </div>
         ))}
       </div>
     )
   };

   export default Objects
